import { useState } from "react";
import Player from "./types/player";

/*
export const players : Player[] = [
  { name: "Olli" },
  { name: "Matti"},
  { name: "Tatti"}
];
*/

export const usePlayers = () => {

  const [ players, setPlayers ] = useState([
    { name: "Olli" },
    { name: "Matti"},
    { name: "Tatti"}
  ]);
  
  return [
    players, setPlayers
  ];
}
